  real(REALKIND),    intent(in)  :: P(0:3,9)
  integer,           intent(in)  :: H(9)
  integer,           intent(in), optional  :: POLSEL(9)
  complex(REALKIND), intent(out) :: M1(1), M2(1)
  complex(REALKIND) :: A(7436)
  ! external WFs
  if (present(POLSEL)) then
    call pol_wf_Q(P(:,1), rZERO, H(1), wf(:,0), POLSEL(1))
    call pol_wf_A(P(:,2), rZERO, H(2), wf(:,-1), POLSEL(2))
    call pol_wf_Q(P(:,3), rZERO, H(3), wf(:,-2), POLSEL(3))
    call pol_wf_A(P(:,4), rZERO, H(4), wf(:,-3), POLSEL(4))
    call pol_wf_A(P(:,5), rZERO, H(5), wf(:,-4), POLSEL(5))
    call pol_wf_Q(P(:,6), rZERO, H(6), wf(:,-5), POLSEL(6))
    call pol_wf_Q(P(:,7), rMB, H(7), wf(:,-6), POLSEL(7))
    call pol_wf_A(P(:,8), rMB, H(8), wf(:,-7), POLSEL(8))
    call pol_wf_S(P(:,9), rMH, H(9), wf(:,-8), POLSEL(9))

  else
    call pol_wf_Q(P(:,1), rZERO, H(1), wf(:,0), 0)
    call pol_wf_A(P(:,2), rZERO, H(2), wf(:,-1), 0)
    call pol_wf_Q(P(:,3), rZERO, H(3), wf(:,-2), 0)
    call pol_wf_A(P(:,4), rZERO, H(4), wf(:,-3), 0)
    call pol_wf_A(P(:,5), rZERO, H(5), wf(:,-4), 0)
    call pol_wf_Q(P(:,6), rZERO, H(6), wf(:,-5), 0)
    call pol_wf_Q(P(:,7), rMB, H(7), wf(:,-6), 0)
    call pol_wf_A(P(:,8), rMB, H(8), wf(:,-7), 0)
    call pol_wf_S(P(:,9), rMH, H(9), wf(:,-8), 0)

