  call vert_SV_V(wf(:,-8),wf(:,5),wf(:,7))
  call vert_WWV_V(wf(:,3),wf(:,4),wf(:,6),wf(:,8))
  call prop_W_W(wf(:,7),Q(:,265),MW,1_intkind1,wf(:,9))
  call vert_QA_Z(gZd,wf(:,-6),wf(:,-7),wf(:,10))
  call prop_W_W(wf(:,10),Q(:,192),MZ,1_intkind1,wf(:,11))
  call vert_WWV_V(wf(:,3),wf(:,11),wf(:,6),wf(:,12))
  call vert_QA_Z(gZl,wf(:,-2),wf(:,-4),wf(:,13))
  call prop_W_W(wf(:,13),Q(:,20),MZ,1_intkind1,wf(:,14))
  call vert_WWV_V(wf(:,14),wf(:,4),wf(:,6),wf(:,15))
  call vert_WWV_V(wf(:,14),wf(:,11),wf(:,6),wf(:,16))
  call vert_SV_V(wf(:,-8),wf(:,6),wf(:,17))
  call vert_WWV_V(wf(:,3),wf(:,4),wf(:,5),wf(:,18))
  call prop_W_W(wf(:,17),Q(:,290),MW,1_intkind1,wf(:,19))
  call vert_WWV_V(wf(:,3),wf(:,11),wf(:,5),wf(:,20))
  call vert_WWV_V(wf(:,14),wf(:,4),wf(:,5),wf(:,21))
  call vert_WWV_V(wf(:,14),wf(:,11),wf(:,5),wf(:,22))
  call vert_SV_V(wf(:,-8),wf(:,14),wf(:,23))
  call vert_WWV_V(wf(:,5),wf(:,6),wf(:,4),wf(:,24))
  call prop_W_W(wf(:,23),Q(:,276),MZ,1_intkind1,wf(:,25))
  call vert_WWV_V(wf(:,5),wf(:,6),wf(:,11),wf(:,26))
  call vert_SV_V(wf(:,-8),wf(:,11),wf(:,27))
  call vert_WWV_V(wf(:,5),wf(:,6),wf(:,3),wf(:,28))
  call prop_W_W(wf(:,27),Q(:,448),MZ,1_intkind1,wf(:,29))
  call vert_WWV_V(wf(:,5),wf(:,6),wf(:,14),wf(:,30))
  call vert_AQ_S(gH,wf(:,-7),wf(:,-6),wf(:,31))
