  call vert_UV_W(wf(:,3),Q(:,20),wf(:,5),Q(:,9),wf(:,37))
  call vert_SSV_V(wf(:,31),wf(:,-8),wf(:,6),wf(:,38))
  call prop_W_W(wf(:,37),Q(:,29),MW,1_intkind1,wf(:,39))
  call vert_UV_W(wf(:,14),Q(:,20),wf(:,5),Q(:,9),wf(:,40))
  call prop_W_W(wf(:,40),Q(:,29),MW,1_intkind1,wf(:,41))
  call vert_UV_W(wf(:,6),Q(:,34),wf(:,3),Q(:,20),wf(:,42))
  call vert_SSV_V(wf(:,31),wf(:,-8),wf(:,5),wf(:,43))
  call prop_W_W(wf(:,42),Q(:,54),MW,1_intkind1,wf(:,44))
  call vert_UV_W(wf(:,6),Q(:,34),wf(:,14),Q(:,20),wf(:,45))
  call prop_W_W(wf(:,45),Q(:,54),MW,1_intkind1,wf(:,46))
  call vert_VV_S(wf(:,14),wf(:,11),wf(:,47))
